import React from 'react';
import { User } from '../models/User';
import { getAllUsers } from '../api/LibraryClient';
// import { QuickTable } from './QuickTable';

interface IBooksDisplayState {
  members: User[];
  isError: boolean;
  errorMessage: string;
}

export class getUser extends React.Component<any, IBooksDisplayState> {

  constructor(props: any) {
    super(props);
    this.state = {
      members: [],
      isError: false,
      errorMessage: '',
    }
  }

  async componentDidMount() {
    try {
      this.setState({
        members: await getAllUsers()
      })
    } catch (e) {
      this.setState({
          members: [],
        isError: true,
        errorMessage: e.message,
      })
    }
  }

  clearError = () => {
    this.setState({
        members: [],
      isError: false,
      errorMessage: '',
    });
  }

  render() {
    if(!this.state.isError) {
      //map to a string so quicktable can render this.
      return this.state.members.map((u:User)=>{
     return(
          <div key={u.id} className="col">
          <span>userid:  {u.id}</span>  
          <span>username:  {u.username}</span>  
          <span>password:  {u.password}</span>  
          <span>firstname: {u.firstname}</span>  
          <span>lastname: {u.lastname}</span>  
          <span>email: {u.email}</span>  
          <span>role: {u.role}</span>  
          </div>
         )      
         })
    } 
else {
      switch(this.state.errorMessage){
          case "Request failed with status code 403":
      return <h2>{this.state.errorMessage} Sorry! finance-manager role is required</h2>

        case "Request failed with status code 402":
      return <h2>{this.state.errorMessage} Please login</h2>

              default:
               return  <h3>Error from getUser: {this.state.errorMessage}</h3>


      } 
    }
  }
}
